import React, { useEffect, useState } from "react";
import api from "../../api/axiosConfig";
import { Link } from "react-router-dom";

function MaterialesList() {
  const [materiales, setMateriales] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    api.get("/materiales/all-materiales")
      .then(response => {
        setMateriales(response.data);
      })
      .catch(error => {
        console.error("Error cargando materiales:", error);
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <h3>Cargando materiales...</h3>;
  }

  return (
    <div style={{ maxWidth: "900px", margin: "0 auto" }}>
      <h2 style={{ textAlign: "center" }}>Listado de Materiales</h2>

      <div style={{ textAlign: "right", marginBottom: "15px" }}>
        <Link to="/materiales/crear">
          <button
            style={{
              padding: "8px 16px",
              backgroundColor: "#4CAF50",
              color: "white",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer"
            }}
          >
            Crear Nuevo Material
          </button>
        </Link>
      </div>

      {materiales.length === 0 ? (
        <p>No hay materiales registrados.</p>
      ) : (
        <table
          style={{
            width: "100%",
            borderCollapse: "collapse",
            backgroundColor: "#f9f9f9"
          }}
        >
          <thead>
            <tr style={{ backgroundColor: "#4CAF50", color: "white" }}>
              <th style={th}>ID</th>
              <th style={th}>Tipo</th>
              <th style={th}>Precio</th>
              <th style={th}>Bolsos</th>
              <th style={th}>Acciones</th>
            </tr>
          </thead>

          <tbody>
            {materiales.map(material => (
              <tr key={material.id} style={tr}>
                <td style={td}>{material.id}</td>
                <td style={td}>{material.tipo}</td>
                <td style={td}>${material.precio}</td>
                <td style={td}>
                  {material.bolsos.length > 0
                    ? material.bolsos.join(", ")
                    : "Ninguno"}
                </td>
                <td style={td}>
                  <Link to={`/materiales/${material.id}`}>
                    <button style={btnVer}>Ver</button>
                  </Link>

                  <Link to={`/materiales/editar/${material.id}`}>
                    <button style={btnEditar}>Editar</button>
                  </Link>

                  <Link to={`/materiales/eliminar/${material.id}`}>
                    <button style={btnEliminar}>Eliminar</button>
                  </Link>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

// --- Estilos reutilizables ---

const th = {
  padding: "10px",
  border: "1px solid #ddd",
  textAlign: "center"
};

const td = {
  padding: "10px",
  border: "1px solid #ddd",
  textAlign: "center"
};

const tr = {
  backgroundColor: "white"
};

const btnVer = {
  marginRight: "5px",
  padding: "5px 10px",
  backgroundColor: "#2196F3",
  color: "white",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer"
};

const btnEditar = {
  marginRight: "5px",
  padding: "5px 10px",
  backgroundColor: "#FFC107",
  color: "black",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer"
};

const btnEliminar = {
  padding: "5px 10px",
  backgroundColor: "#F44336",
  color: "white",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer"
};

export default MaterialesList;
